import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";
function Expenses(props) {
  return (
    <div>
      <ExpenseItem
        title={props.date[0].title}
        prise={props[0].prise}
        date={props[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[1].title}
        prise={props[1].prise}
        date={props[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[2].title}
        prise={props[2].prise}
        date={props[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[3].title}
        prise={props[3].prise}
        date={props[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
